<!DOCTYPE html>
<html>
<!doctype html>
<html lang="sv">
<head>
<meta charset="UTF-8">

<style>
  /* --- Exakt dokumentstorlek i pixlar + noll marginaler --- */
  @page {
    size: 1080px 1100px;
    margin: 10;
  }

body {
  height: 60%;      /* 100% av 1100px */
}

.wrapper {
  height: 60%;      /* om du vill innesluta tabellen i en container */
  max-height: 60%;  /* extra säkerhet */
  overflow: hidden;  /* inget kan sticka över */
}
  html, body {
    margin: 0;
    padding: 0;
    color: #000;
    }  

  h1 {
    font-size: 28px;
    margin: 0 0 10px 0;
  }

  :root {
    --row-h: 18mm;        /* din radhöjd – behåll det värde du använder */
    --ikon-size: 54px;    /* MINDRE ikon så den inte driver upp höjden */
    --gap: 8px;
  }

  /* === NYTT === Centrera hela tabellen på sidan och lås kolumnlayouten */
  .allergen-tabell {
    margin-top: 60px;
    margin: 0 auto;           /* centrerar tabellen horisontellt */
    width: 80%;              /* låter colgroup procenträknas mot full bredd */
    max-width: 80%;          /* ingen overflow i A3-ytan */
    border-collapse: collapse;
    table-layout: fixed;      /* tvingar fasta kolumnbredder enligt colgroup */
    text-align: center;       /* grundcentrering av innehåll */
  }

  /* Första kolumnen: ikon + text i grid, men med text FÖRE ikon */
  .allergen-tabell td.namn {
    padding: 0 0.5rem;
    line-height: 1.2;
    white-space: normal;
    height: var(--row-h);
    text-align: left; /* behåll vänsterställd text i första kolumnen om du vill */
  }

  .namn-wrap {
    height: 100%;
    display: grid;
    /* textkolumnen tar plats (1fr), ikonen är auto-bredd */
    grid-template-columns: 1fr auto;
    align-items: center;      /* vertikal centrering */
    column-gap: var(--gap);
  }

  /* Själva ikonen: liten och aldrig högre än raden */
  .namn-wrap .ikon {
    width: var(--ikon-size);
    height: var(--ikon-size);
    max-height: calc(var(--row-h) - 15px); /* säkerhetsmarginal */
    display: block;
  }

  /* Ikonen efter texten */
  .namn-wrap .label { order: 1; }
  .namn-wrap .ikon  { order: 2; }

  /* Övriga kolumner (prick) – centrerade och vertikalt mittade */
  .allergen-tabell td:not(.namn) {
    padding: 0;
    text-align: center;
    vertical-align: middle;
    height: var(--row-h);
    line-height: var(--row-h);  /* radens höjd = underlättar vertikal centrering */
  }

  /* === NYTT === Bullet-/punktcentrering som inte påverkar radhöjd */
  .dot {
    display: inline-block;
    font-size: 74px;
    line-height: 1;           /* undvik extra vertikal spacing */
    vertical-align: middle;   /* mittas mot cellens linjehöjd */
  }

  /* Om du använder UL/LI i celler och vill centrera punkter + text */
  .centered-bullets {
    list-style-position: inside;
    padding: 0;
    margin: 0;
    text-align: center;
  }

  /* Header-rad */
  .allergen-tabell thead th {
    background-color: #f0f0f0;
    font-weight: bold;
    text-align: center;       /* rubriker centreras */
    height: var(--row-h);
    line-height: var(--row-h);
  }

/* Tunn, diskret grid runt alla celler */
.allergen-tabell {
  border-collapse: collapse; /* du har redan detta */
  border: 0;                 /* ingen yttre ram om du inte vill */
}

.allergen-tabell th,
.allergen-tabell td {
  border: 0.5pt solid #d6d6d6; /* hårfin linje */
}

/* Valfritt: starkare ram runt headern */
.allergen-tabell thead th {
  border-bottom: 1pt solid #bdbdbd;
}
</style>
</head>
